import React from 'react';
import {NavLink} from 'react-router-dom';
import './Header.css';

const header = (props) => {
    return (
        <div className = "Header">
            <p>Return to lists</p>
            <h1>{props.pageTitle}</h1>
        </div>
    )
}

export default header;
